  \"2015-01-22T18:54:39.017995\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-current-state-legislative-district-sl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. State Legislative Districts (SLDs) are the areas from which members are
  elected to Staten               legislatures. The SLDs embody the upper (senate)
  and lower (house) chambers of the State legislature. Nebraska has a unicameral legislature
  and then               District of Columbia has a single council, both of which
  the Census Bureau treats as upper-chamber legislative areas for the purpose of datan
  \              presentation; there are no data by SLDL for either Nebraska or the
  District of Columbia. A unique three-character census code, identified by Staten
  \              participants, is assigned to each SLD within a State. In Connecticut,
  Hawaii, Illinois, Louisiana, Maine, Maryland, Massachusetts, New Jersey, Ohio, andn
  \              Puerto Rico, the Redistricting Data Program (RDP) participant did
  not define the SLDs to cover all of the State or State equivalent area. In these
  areasn               with no SLDs defined, the code \"ZZZ\" has been assigned, which
  is treated within county as a single SLD for purposes of data presentation. The
  boundariesn               of the 2010 Census State legislative districts were provided
  by State-level participants through the Redistricting Data Program (RDP) and reflect
  then               districts used to elect members in the last election before 2010.\",\n\t\"license_title\":
